import styled from "styled-components"

export default function Entrar(){

    return (
        <CadastroPagina>
        <div>
        <h1>Login</h1>
        </div>
        <EntrarContainer>
            <form>
                <input
                placeholder="E-mail"/>
                <input
                placeholder="Senha"/>
                <button type="button"><h1>Entrar!</h1></button>
            </form>
        </EntrarContainer>
        </CadastroPagina>
    )
}

const CadastroPagina = styled.main`
width: 100%;
height: 90%;
display: flex;
flex-direction: column;
align-items: center;
justify-content: space-evenly;
h1{
    color: black;
}
`

const EntrarContainer = styled.div`
width: 70%;
height: 80%;
box-sizing: border-box;
border: 2px solid black;
display: flex;
flex-direction: column;
justify-content: space-evenly;
input {
    width: 80%;
}
`
